import{_ as i,o as l,c as e,a as r}from"./app.75b474e0.js";const a={},n=r('<h1 id="\u7CFB\u7EDF\u8BBE\u8BA1" tabindex="-1"><a class="header-anchor" href="#\u7CFB\u7EDF\u8BBE\u8BA1" aria-hidden="true">#</a> \u7CFB\u7EDF\u8BBE\u8BA1</h1><h1 id="\u56FE\u7684\u9009\u62E9" tabindex="-1"><a class="header-anchor" href="#\u56FE\u7684\u9009\u62E9" aria-hidden="true">#</a> \u56FE\u7684\u9009\u62E9</h1><p>\uFF081\uFF09\u9700\u6C42\u5206\u6790\u9636\u6BB5\uFF1A\u6570\u636E\u6D41\u56FE\u3002</p><p>\uFF082\uFF09\u6982\u8981\u8BBE\u8BA1\u9636\u6BB5\uFF1A\u6A21\u5757\u7ED3\u6784\u56FE\u3001\u5C42\u6B21\u56FE\u548CHIPO\u56FE\u3002</p><p>\uFF083\uFF09\u8BE6\u7EC6\u8BBE\u8BA1\u9636\u6BB5\uFF1A\u7A0B\u5E8F\u6D41\u7A0B\u56FE\u3001\u4F2A\u4EE3\u7801\u3001\u76D2\u56FE\u3002</p><h2 id="\u5904\u7406\u6D41\u7A0B\u8BBE\u8BA1" tabindex="-1"><a class="header-anchor" href="#\u5904\u7406\u6D41\u7A0B\u8BBE\u8BA1" aria-hidden="true">#</a> \u5904\u7406\u6D41\u7A0B\u8BBE\u8BA1</h2><p>\u4E1A\u52A1\u6D41\u7A0B\u5EFA\u6A21\uFF1A</p><ol><li><strong>\u6807\u6746\u7784\u51C6</strong> \u786E\u5B9A\u9700\u8981\u8FDB\u884C\u6807\u6746\u7814\u7A76\u7684\u6D41\u7A0B\u548C\u5F71\u54CD\u6D41\u7A0B\u6210\u8D25\u7684\u5173\u952E\u56E0\u7D20\u786E\u5B9A\u7784\u51C6\u76EE\u6807\u7684\u6807\u6746\u4F01\u4E1A\u3001\u7EC4\u7EC7\u53CA\u5176\u6D41\u7A0B\u901A\u8FC7\u8D70\u8BBF\u3001\u8C03\u7814\u3001\u4F1A\u8C08\u3001\u5E7F\u544A\u7B49\u91C7\u96C6\u6570\u636E\uFF0C\u5E76\u8FDB\u884C\u5206\u6790\u4ECE\u4F17\u591A\u6807\u6746\u6570\u636E\u4E2D\uFF0C\u9009\u5B9A\u6700\u4F73\u6539\u8FDB\u6807\u51C6\u3002 \u6839\u636E\u6807\u6746\u6307\u6807\uFF0C\u8BC4\u4F30\u4F01\u4E1A\u7684\u65E2\u6709\u6D41\u7A0B\uFF0C\u5E76\u786E\u7ACB\u6539\u8FDB\u76EE\u6807</li><li>IDEF\uFF08\u4E00\u7CFB\u5217\u5EFA\u6A21\u3001\u5206\u6790\u548C\u4EFF\u771F\u65B9\u6CD5\u7684\u7EDF\u79F0\uFF09 IDEF0\uFF08\u4E1A\u52A1\u6D41\u7A0B \u529F\u80FD\u5EFA\u6A21\uFF09\u3001 IDEF1\uFF08\u4FE1\u606F\u5EFA\u6A21\uFF09\u3001 IDEF1X\uFF08\u6570\u636E\u5EFA\u6A21\uFF09\u3001 IDEF2\uFF08\u4EFF\u771F\u5EFA\u6A21\u8BBE\u8BA1\uFF09\u3001 IDEF3\uFF08\u8FC7\u7A0B\u63CF\u8FF0\u83B7\u53D6\uFF09\u3001 IDEF4\uFF08\u9762\u5411\u5BF9\u8C61\u8BBE\u8BA1\uFF09\u3001 IDEF5\uFF08\u672C\u4F53\u8BBA\u63CF\u8FF0\u83B7\u53D6\uFF09\u3001 IDEF6\uFF08\u8BBE\u8BA1\u539F\u7406\u83B7\u53D6\uFF09\u3001 IDEF7\uFF08\u4FE1\u606F\u7CFB\u7EDF\u5BA1\u8BA1\uFF09\u3001 IDEF8\uFF08\u7528\u6237\u754C\u9762\u5EFA\u6A21\uFF09\u3001 IDEF9\uFF08\u573A\u666F\u9A71\u52A8\u4FE1\u606F\u7CFB\u7EDF\u8BBE\u8BA1\uFF09\u3001 IDEF10\uFF08\u5B9E\u65BD\u67B6\u6784\u5EFA\u6A21\uFF09\u3001 IDEF11\uFF08\u4FE1\u606F\u5236\u54C1\u5EFA\u6A21\uFF09\u3001 IDEF12\uFF08\u7EC4\u7EC7\u5EFA\u6A21\uFF09\u3001 IDEF13\uFF08\u4E09\u6A21\u5F0F\u6620\u5C04\u8BBE\u8BA1\uFF09 IDEF14\uFF08\u7F51\u7EDC\u89C4\u5212\uFF09\u3002</li><li>DEMO\uFF08\u7EC4\u7EC7\u52A8\u6001\u672C\u8D28\u5EFA\u6A21\u6CD5\uFF09</li><li>Petri\u7F51</li><li>\u4E1A\u52A1\u6D41\u7A0B\u5EFA\u6A21\u8BED\u8A00</li><li>\u4E1A\u52A1\u6D41\u7A0B\u91CD\u7EC4<strong>BPR</strong> BPR\u662F\u5BF9\u4F01\u4E1A\u7684<strong>\u4E1A\u52A1\u6D41\u7A0B\u8FDB\u884C\u6839\u672C\u6027</strong>\u7684\u518D\u601D\u8003\u548C<strong>\u5F7B\u5E95\u6027</strong>\u7684\u518D\u8BBE\u8BA1\uFF0C\u4ECE\u800C\u83B7\u5F97\u53EF\u4EE5\u7528\u8BF8\u5982\u6210\u672C\u3001\u8D28\u91CF\u3001\u670D\u52A1\u548C\u901F\u5EA6\u7B49\u65B9\u9762\u7684\u4E1A\u7EE9\u6765\u8861\u91CF\u7684\u663E\u8457\u6027\u7684\u6210\u5C31</li><li>\u4E1A\u52A1\u6D41\u7A0B\u7BA1\u7406<strong>BPM</strong> BPM\u662F\u4E00\u79CD\u4EE5<strong>\u89C4\u8303\u5316</strong>\u7684\u6784\u9020\u7AEF\u5230\u7AEF\u7684\u5353\u8D8A\u4E1A\u52A1\u6D41\u7A0B\u4E3A\u4E2D\u5FC3\uFF0C\u4EE5\u6301\u7EED\u7684\u63D0\u9AD8\u7EC4\u7EC7\u4E1A\u52A1\u7EE9\u6548\u4E3A\u76EE\u7684\u7684<strong>\u7CFB\u7EDF\u5316</strong>\u65B9\u6CD5\u3002</li></ol><p>IDEFO\u7684\u5EFA\u6A21\u7279\u70B9\u4F7F\u5B83\u53EF\u4EE5\u7528\u6765\u63CF\u8FF0\u4F01\u4E1A\u7684\u4E1A\u52A1\u6D41\u7A0B\uFF0C\u5B83\u7684\u9636\u68AF\u5C42\u6B21\u53EF\u7528\u6765\u63CF\u8FF0\u4E1A\u52A1\u6D41\u7A0B\u7684\u9636\u68AF\u7ED3\u6784\u7279\u6027\u3002\u4ECE\u9AD8\u5C42\u6B21\u770B\uFF0CIDEFO\u7684\u529F\u80FD\u6D3B\u52A8\u4E0E\u4E1A\u52A1\u6D41\u7A0B\u76F8\u5BF9\u5E94\uFF1B\u800C\u4ECE\u4F4E\u5C42\u6B21\u770B\uFF0C\u529F\u80FD\u6D3B\u52A8\u4E0E\u6D41\u7A0B\u7684\u4E1A\u52A1\u6D3B\u52A8\u76F8\u5BF9\u5E94\u3002\u5229\u7528IEDFO\u7684\u6D3B\u52A8\u63CF\u8FF0\u65B9\u5F0F\u53CA\u6D3B\u52A8\u4E4B\u95F4\u7684\u8054\u7CFB\u65B9\u5F0F\uFF0C\u53EF\u4EE5\u5F88\u597D\u5730\u63CF\u8FF0\u4E1A\u52A1\u6D41\u7A0B\u7684\u67B6\u6784\u3002IDEF0\u6A21\u578B\u5F62\u8C61\u3001\u76F4\u89C2\u3001\u6613\u4E8E\u7406\u89E3\u548C\u5206\u6790\uFF0C\u4F46\u662F\uFF0C\u8FD9\u79CD\u56FE\u5F62\u5316\u7684\u6A21\u578B\u6CA1\u6709\u6DF1\u523B\u63ED\u793A\u4E1A\u52A1\u6D41\u7A0B\u7684\u5185\u90E8\u7ED3\u6784\u7279\u5F81\u548C\u89C4\u5F8B\uFF0C\u800C\u4E14\u5F53\u4E1A\u52A1\u6D41\u7A0B\u5F88\u590D\u6742\u65F6\uFF0C\u6240\u5BF9\u5E94\u7684\u6709\u5411\u56FE\u5C31\u6210\u4E3A\u4E00\u4E2A\u76F8\u4E92\u4EA4\u53C9\u3001\u6DF7\u4E71\u7684\u7F51\u7EDC\uFF0C\u4E0D\u5229\u4E8E\u5206\u6790\u6D41\u7A0B\u7684\u7279\u5F81\u3002</p><p>BPM\u4E0EBPR\u7BA1\u7406\u601D\u60F3\u6700\u6839\u672C\u7684\u4E0D\u540C\u5C31\u5728\u4E8E\u6D41\u7A0B\u7BA1\u7406\u5E76\u4E0D\u8981\u6C42\u5BF9\u6240\u6709\u7684\u6D41\u7A0B\u8FDB\u884C\u518D\u9020\u3002\u6784\u9020\u5353\u8D8A\u7684\u4E1A\u52A1\u6D41\u7A0B\u5E76\u4E0D\u662F\u6D41\u7A0B\u518D\u9020\uFF0C\u800C\u662F\u6839\u636E\u73B0\u6709\u6D41\u7A0B\u7684\u5177\u4F53\u60C5\u51B5\uFF0C\u5BF9\u6D41\u7A0B\u8FDB\u884C\u89C4\u8303\u5316\u7684\u8BBE\u8BA1</p><h2 id="\u4EBA\u673A\u754C\u9762\u8BBE\u8BA1" tabindex="-1"><a class="header-anchor" href="#\u4EBA\u673A\u754C\u9762\u8BBE\u8BA1" aria-hidden="true">#</a> \u4EBA\u673A\u754C\u9762\u8BBE\u8BA1</h2><blockquote><ol><li><p><strong>\u7F6E\u4E8E\u7528\u6237\u63A7\u5236\u4E4B\u4E0B</strong> \u4EE5\u4E0D\u5F3A\u8FEB\u7528\u6237\u8FDB\u5165\u4E0D\u5FC5\u8981\u7684\u6216\u4E0D\u5E0C\u671B\u7684\u52A8\u4F5C\u7684\u65B9\u5F0F\u6765\u5B9A\u4E49\u4EA4\u4E92\u65B9\u5F0F \u63D0\u4F9B\u7075\u6D3B\u7684\u4EA4\u4E92 \u5141\u8BB8\u7528\u6237\u4EA4\u4E92\u53EF\u4EE5\u88AB\u4E2D\u65AD\u548C\u64A4\u6D88 \u5F53\u6280\u80FD\u7EA7\u522B\u589E\u52A0\u65F6\u53EF\u4EE5\u4F7F\u4EA4\u4E92\u6D41\u6C34\u5316\u5E76\u5141\u8BB8\u5B9A\u5236\u4EA4\u4E92 \u4F7F\u7528\u6237\u9694\u79BB\u5185\u90E8\u6280\u672F\u7EC6\u8282 \u8BBE\u8BA1\u5E94\u5141\u8BB8\u7528\u6237\u548C\u51FA\u73B0\u5728\u5C4F\u5E55\u4E0A\u7684\u5BF9\u8C61\u76F4\u63A5\u4EA4\u4E92</p></li><li><p><strong>\u51CF\u5C11\u7528\u6237\u7684\u8BB0\u5FC6\u8D1F\u62C5</strong> \u51CF\u5C11\u5BF9\u77ED\u671F\u8BB0\u5FC6\u7684\u8981\u6C42 \u5EFA\u7ACB\u6709\u610F\u4E49\u7684\u7F3A\u7701 \u5B9A\u4E49\u76F4\u89C9\u6027\u7684\u6377\u5F84 \u754C\u9762\u7684\u89C6\u89C9\u5E03\u5C40\u5E94\u8BE5\u57FA\u4E8E\u771F\u5B9E\u4E16\u754C\u7684\u9690\u55BB \u4EE5\u4E0D\u65AD\u8FDB\u5C55\u7684\u65B9\u5F0F\u63ED\u793A\u4FE1\u606F</p></li><li><p><strong>\u4FDD\u6301\u754C\u9762\u7684\u4E00\u81F4\u6027</strong> \u5141\u8BB8\u7528\u6237\u5C06\u5F53\u524D\u4EFB\u52A1\u653E\u5165\u6709\u610F\u4E49\u7684\u8BED\u5883\u5728\u5E94\u7528\u7CFB\u5217\u5185\u4FDD\u6301\u4E00\u81F4\u6027 \u5982\u8FC7\u53BB\u7684\u4EA4\u4E92\u6A21\u578B\u5DF2\u5EFA\u7ACB\u8D77\u4E86\u7528\u6237\u671F\u671B\uFF0C\u9664\u975E\u6709\u8FEB\u4E0D\u5F97\u5DF2\u7684\u7406\u7531\u4E0B\u8981\u6539\u53D8\u5B83</p></li></ol></blockquote><h2 id="\u7ED3\u6784\u5316\u8BBE\u8BA1" tabindex="-1"><a class="header-anchor" href="#\u7ED3\u6784\u5316\u8BBE\u8BA1" aria-hidden="true">#</a> \u7ED3\u6784\u5316\u8BBE\u8BA1</h2><p>\u7CFB\u7EDF\u8BBE\u8BA1\u7684\u4E3B\u8981\u5185\u5BB9\u5305\u62EC<strong>\u6982\u8981\u8BBE\u8BA1\u548C\u8BE6\u7EC6\u8BBE\u8BA1</strong>\u3002</p><ul><li>\u62BD\u8C61\u5316</li><li>\u81EA\u9876\u800C\u4E0B\u3001\u9010\u6B65\u6C42\u7CBE</li><li>\u4FE1\u606F\u9690\u853D</li><li>\u6A21\u5757\u72EC\u7ACB\uFF08\u9AD8\u5185\u805A\u3001\u4F4E\u8026\u5408\uFF09</li></ul><p>\u6982\u8981\u8BBE\u8BA1\u53C8\u79F0\u4E3A\u7CFB\u7EDF\u603B\u4F53\u7ED3\u6784\u8BBE\u8BA1\uFF0C\u5B83\u662F\u7CFB\u7EDF\u5F00\u53D1\u8FC7\u7A0B\u4E2D\u5F88\u5173\u952E\u7684\u4E00\u6B65\uFF0C \u5176\u4E3B\u8981\u4EFB\u52A1\u662F\u5C06\u7CFB\u7EDF\u7684\u529F\u80FD\u9700\u6C42\u5206\u914D\u7ED9\u8F6F\u4EF6\u6A21\u5757\uFF0C<strong>\u786E\u5B9A\u6BCF\u4E2A\u6A21\u5757\u7684\u529F\u80FD\u548C\u8C03\u7528\u5173\u7CFB\uFF0C\u5F62\u6210\u8F6F\u4EF6\u7684\u6A21\u5757\u7ED3\u6784\u56FE\uFF0C\u5373\u7CFB\u7EDF\u7ED3\u6784\u56FE\u3002</strong> \u5728\u6982\u8981\u8BBE\u8BA1\u4E2D\uFF0C\u5C06\u7CFB\u7EDF\u5F00\u53D1\u7684\u603B\u4EFB\u52A1\u5206\u89E3\u6210\u8BB8\u591A\u4E2A\u57FA\u672C\u7684\u3001<strong>\u5177\u4F53\u7684\u4EFB\u52A1</strong>\uFF0C\u4E3A\u6BCF\u4E2A\u5177\u4F53\u4EFB\u52A1\u9009\u62E9\u9002\u5F53\u7684\u6280\u672F\u624B\u6BB5\u548C\u5904\u7406\u65B9\u6CD5\u7684\u8FC7\u7A0B\u79F0\u4E3A\u8BE6\u7EC6\u8BBE\u8BA1\u3002</p><p><img src="https://img-blog.csdnimg.cn/20210605200208817.png?" alt="img"></p><h3 id="\u5185\u805A\u4E0E\u8026\u5408" tabindex="-1"><a class="header-anchor" href="#\u5185\u805A\u4E0E\u8026\u5408" aria-hidden="true">#</a> \u5185\u805A\u4E0E\u8026\u5408</h3><blockquote><p><strong>\u5185\u805A</strong></p><ul><li>\u529F\u80FD\u5185\u805A\uFF1A\u5B8C\u6210\u4E00\u4E2A\u5355\u4E00\u529F\u80FD\uFF0C\u5404\u4E2A\u90E8\u5206\u534F\u540C\u5DE5\u4F5C\uFF0C\u7F3A\u4E00\u4E0D\u53EF</li><li>\u987A\u5E8F\u5185\u805A\uFF1A\u5904\u7406\u5143\u7D20\u76F8\u5173\uFF0C\u800C\u4E14\u5FC5\u987B\u987A\u5E8F\u6267\u884C</li><li>\u901A\u4FE1\u5185\u805A\uFF1A\u6240\u6709\u5904\u7406\u5143\u7D20\u96C6\u4E2D\u5728\u4E00\u4E2A\u6570\u636E\u7ED3\u6784\u7684\u533A\u57DF\u4E0A</li><li>\u8FC7\u7A0B\u5185\u805A\uFF1A\u5904\u7406\u5143\u7D20\u76F8\u5173\uFF0C\u800C\u4E14\u5FC5\u987B\u6309\u7279\u5B9A\u7684\u6B21\u5E8F\u6267\u884C</li><li>\u77AC\u65F6\u5185\u805A\uFF08\u65F6\u95F4\u5185\u805A\uFF09\uFF1A\u6240\u5305\u542B\u7684\u4EFB\u52A1\u5FC5\u987B\u5728\u540C\u4E00\u65F6\u95F4\u95F4\u9694\u5185\u6267\u884C</li><li>\u903B\u8F91\u5185\u805A\uFF1A\u5B8C\u6210\u903B\u8F91\u4E0A\u76F8\u5173\u7684\u4E00\u7EC4\u4EFB\u52A1</li><li>\u5076\u7136\u5185\u805A\uFF08\u5DE7\u5408\u5185\u805A\uFF09\uFF1A\u5B8C\u6210\u4E00\u7EC4\u6CA1\u6709\u5173\u7CFB\u6216\u677E\u6563\u5173\u7CFB\u7684\u4EFB\u52A1</li></ul><p>\u8026\u5408</p><ul><li>\u975E\u76F4\u63A5\u8026\u5408\uFF1A\u4E24\u4E2A\u6A21\u5757\u4E4B\u95F4\u6CA1\u6709\u76F4\u63A5\u5173\u7CFB\uFF0C\u5B83\u4EEC\u4E4B\u95F4\u7684\u8054\u7CFB\u5B8C\u5168\u662F\u901A\u8FC7\u4E3B\u6A21\u5757\u7684\u63A7\u5236\u548C\u8C03\u7528\u6765\u5B9E\u73B0\u7684</li><li>\u6570\u636E\u8026\u5408\uFF1A\u4E00\u7EC4\u6A21\u5757\u501F\u52A9\u53C2\u6570\u8868\u4F20\u9012\u7B80\u5355\u6570\u636E</li><li>\u6807\u8BB0\u8026\u5408\uFF1A\u4E00\u7EC4\u6A21\u5757\u901A\u8FC7\u53C2\u6570\u8868\u4F20\u9012\u8BB0\u5F55\u4FE1\u606F\uFF08\u6570\u636E\u7ED3\u6784\uFF09</li><li>\u63A7\u5236\u8026\u5408\uFF1A\u6A21\u5757\u4E4B\u95F4\u4F20\u9012\u7684\u4FE1\u606F\u4E2D\u5305\u542B\u7528\u4E8E\u63A7\u5236\u6A21\u5757\u5185\u90E8\u903B\u8F91\u7684\u4FE1\u606F</li><li>\u5916\u90E8\u8026\u5408\uFF1A\u4E00\u7EC4\u6A21\u5757\u90FD\u8BBF\u95EE\u540C\u4E00\u5168\u5C40\u7B80\u5355\u53D8\u91CF\uFF0C\u800C\u4E14\u4E0D\u662F\u901A\u8FC7\u53C2\u6570\u8868\u4F20\u9012\u8BE5\u5168\u5C40\u53D8\u91CF\u7684\u4FE1\u606F</li><li>\u516C\u5171\u8026\u5408\uFF1A\u591A\u4E2A\u6A21\u5757\u90FD\u8BBF\u95EE\u540C\u4E00\u4E2A\u516C\u5171\u6570\u636E\u73AF\u5883</li><li>\u5185\u5BB9\u8026\u5408\uFF1A\u4E00\u4E2A\u6A21\u5757\u771F\u63A5\u8BBF\u95EE\u53E6\u4E00\u4E2A\u6A21\u5757\u7684\u5185\u90E8\u6570\u636E\uFF1B\u4E00\u4E2A\u6A21\u5757\u4E0D\u901A\u8FC7\u6B63\u5E38\u5165\u53E3\u8F6C\u5230\u53E6\u4E00\u4E2A\u6A21\u5757\u7684</li></ul></blockquote><h2 id="\u9762\u5411\u5BF9\u8C61\u8BBE\u8BA1" tabindex="-1"><a class="header-anchor" href="#\u9762\u5411\u5BF9\u8C61\u8BBE\u8BA1" aria-hidden="true">#</a> \u9762\u5411\u5BF9\u8C61\u8BBE\u8BA1</h2><h3 id="\u57FA\u672C\u8FC7\u7A0B" tabindex="-1"><a class="header-anchor" href="#\u57FA\u672C\u8FC7\u7A0B" aria-hidden="true">#</a> \u57FA\u672C\u8FC7\u7A0B</h3><ol><li>\u5206\u6790\u6A21\u578B\uFF1A\u8BBE\u8BA1\u7528\u4F8B\u6A21\u578B\uFF0C \u5206\u6790\u6A21\u578B</li><li>\u8BBE\u8BA1\u5E08\uFF1A\u8BBE\u8BA1\u7528\u4F8B\u5B9E\u73B0\u65B9\u6848\uFF0C\u8BBE\u8BA1\u6280\u672F\u652F\u6491\u5B9E\u65BD\uFF0C\u8BBE\u8BA1\u7528\u6237\u754C\u9762\uFF0C\u7EC6\u5316\u8BBE\u8BA1\u6A21\u578B</li><li>\u8BBE\u8BA1\u6A21\u578B\uFF1A\u67B6\u6784\u56FE\uFF08\u7528\u5305\u56FE\u8868\u793A\uFF09\uFF0C\u7528\u4F8B\u5B9E\u73B0\u56FE\uFF08\u7528\u4EA4\u4E92\u56FE\u8868\u793A\uFF09\uFF0C\u7C7B\u56FE\uFF08\u5B8C\u6574\u3001\u7CBE\u786E\uFF09\uFF0C\u5176\u4ED6\uFF08\u72B6\u6001\u56FE\u3001\u6D3B\u52A8\u56FE\u7B49\uFF09</li></ol><h3 id="\u8BBE\u8BA1\u539F\u5219" tabindex="-1"><a class="header-anchor" href="#\u8BBE\u8BA1\u539F\u5219" aria-hidden="true">#</a> \u8BBE\u8BA1\u539F\u5219</h3><ul><li>\u5355\u4E00\u804C\u8D23\u539F\u5219\uFF1A\u8BBE\u8BA1\u76EE\u7684\u5355\u4E00\u7684\u7C7B</li><li>\u5F00\u653E-\u5C01\u95ED\u539F\u5219\uFF1A\u5BF9\u6269\u5C55\u5F00\u653E\uFF0C\u5BF9\u4FEE\u6539\u5C01\u95ED</li><li>\u674E\u6C0F\uFF08Liskov\uFF09\u66FF\u6362\u539F\u5219\uFF1A\u5B50\u7C7B\u53EF\u4EE5\u66FF\u6362\u7236\u7C7B\u4F9D\u8D56\u5012\u7F6E\u539F\u5219\uFF1A\u8981\u4F9D\u8D56\u4E8E\u62BD\u8C61\uFF0C\u800C\u4E0D\u662F\u5177\u4F53\u5B9E\u73B0\uFF1B\u9488\u5BF9\u63A5\u53E3\u7F16\u7A0B\uFF0C\u4E0D\u8981\u9488\u5BF9\u5B9E\u73B0\u7F16\u7A0B</li><li>\u63A5\u53E3\u9694\u79BB\u539F\u5219\uFF1A\u4F7F\u7528\u591A\u4E2A\u4E13\u95E8\u7684\u63A5\u53E3\u6BD4\u4F7F\u7528\u5355\u4E00\u7684\u603B\u63A5\u53E3\u8981\u597D</li><li>\u7EC4\u5408\u91CD\u7528\u539F\u5219\uFF1A\u8981\u5C3D\u91CF\u4F7F\u7528\u7EC4\u5408\uFF0C\u800C\u4E0D\u662F\u7EE7\u627F\u5173\u7CFB\u8FBE\u5230\u91CD\u7528\u76EE\u7684</li><li>\u8FEA\u7C73\u7279\uFF08Demeter\uFF09\u539F\u5219\uFF08\u6700\u5C11\u77E5\u8BC6\u6CD5\u5219\uFF09\uFF1A\u4E00\u4E2A\u5BF9\u8C61\u5E94\u5F53\u5BF9\u5176\u4ED6\u5BF9\u8C61\u6709\u5C3D\u53EF\u80FD\u5C11\u7684\u4E86\u89E3</li></ul><h3 id="\u8BBE\u8BA1\u6A21\u5F0F" tabindex="-1"><a class="header-anchor" href="#\u8BBE\u8BA1\u6A21\u5F0F" aria-hidden="true">#</a> <strong>\u8BBE\u8BA1\u6A21\u5F0F</strong></h3><p><img src="https://img-blog.csdnimg.cn/20210605200338139.png?" alt="img"></p><p><strong>\u6A21\u5F0F\u6982\u5FF5</strong></p><p>\u67B6\u6784\u6A21\u5F0F\uFF1A\u8F6F\u4EF6\u8BBE\u8BA1\u4E2D\u7684\u9AD8\u5C42\u51B3\u7B56\uFF0C\u4F8B\u5982C/S\u7ED3\u6784\u5C31\u5C5E\u4E8E\u67B6\u6784\u6A21\u5F0F\uFF0C\u67B6\u6784\u6A21\u5F0F\u53CD\u6620\u4E86\u5F00\u53D1\u8F6F\u4EF6\u7CFB\u7EDF\u8FC7\u7A0B\u4E2D\u6240\u4F5C\u7684\u57FA\u672C\u8BBE\u8BA1\u51B3\u7B56</p><p>\u8BBE\u8BA1\u6A21\u5F0F\uFF1A\u4E3B\u8981\u5173\u6CE8\u8F6F\u4EF6\u7CFB\u7EDF\u7684\u8BBE\u8BA1\uFF0C\u4E0E\u5177\u4F53\u7684\u5B9E\u73B0\u8BED\u8A00\u65E0\u5173</p><p>\u60EF\u7528\u6CD5\uFF1A\u662F\u6700\u4F4E\u5C42\u7684\u6A21\u5F0F\uFF0C\u5173\u6CE8\u8F6F\u4EF6\u7CFB\u7EDF\u7684\u8BBE\u8BA1\u4E0E\u5B9E\u73B0\uFF0C\u5B9E\u73B0\u65F6\u901A\u8FC7\u67D0\u79CD\u7279\u5B9A\u7684\u7A0B\u5E8F\u8BBE\u8BA1\u8BED\u8A00\u6765\u63CF\u8FF0\u6784\u4EF6\u4E0E\u6784\u4EF6\u4E4B\u95F4\u7684\u5173\u7CFB\u3002\u6BCF\u79CD\u7F16\u7A0B\u8BED\u8A00\u90FD\u6709\u5B83\u81EA\u5DF1\u7279\u5B9A\u7684\u6A21\u5F0F\uFF0C\u5373\u8BED\u8A00\u7684\u60EF\u7528\u6CD5\u3002\u4F8B\u5982\u5F15\u7528-\u8BA1\u6570\u5C31\u662FC++\u8BED\u8A00\u4E2D\u7684\u4E00\u79CD\u60EF\u7528\u6CD5</p><h1 id="\u9006\u5411\u5DE5\u7A0B" tabindex="-1"><a class="header-anchor" href="#\u9006\u5411\u5DE5\u7A0B" aria-hidden="true">#</a> \u9006\u5411\u5DE5\u7A0B</h1><p>\u9006\u5411\u5DE5\u7A0B\uFF08reverse engineering\uFF09\u6709\u7684\u4EBA\u4E5F\u53EB\u53CD\u6C42\u5DE5\u7A0B\uFF0C\u5176\u5927\u610F\u662F\u6839\u636E\u5DF2\u6709\u7684\u4E1C\u897F\u548C\u7ED3\u679C\uFF0C\u901A\u8FC7\u5206\u6790\u6765\u63A8\u5BFC\u51FA\u5177\u4F53\u7684\u5B9E\u73B0\u65B9\u6CD5\u3002\u8F6F\u4EF6\u9006\u5411\u5DE5\u7A0B\u7684\u57FA\u672C\u539F\u7406\u662F\u62BD\u53D6\u8F6F\u4EF6\u7CFB\u7EDF\u7684\u4E3B\u8981\u90E8\u5206\u800C\u9690\u85CF\u7EC6\u8282\uFF0C\u7136\u540E\u4F7F\u7528\u62BD\u53D6\u51FA\u7684\u5B9E\u4F53\u5728\u9AD8\u5C42\u4E0A\u63CF\u8FF0\u8F6F\u4EF6\u7CFB\u7EDF\u3002 \u9006\u5411\u5DE5\u7A0B\u62BD\u53D6\u7684\u5B9E\u4F53\u5E94\u6BD4\u6E90\u4EE3\u7801\u66F4\u5BB9\u6613\u63A8\u7406\u548C\u63A5\u8FD1\u5E94\u7528\u9886\u57DF\uFF0C\u540C\u65F6\u5728\u9AD8\u5C42\u4E0A\u5BF9\u8F6F\u4EF6\u7CFB\u7EDF\u7684\u62BD\u8C61\u8868\u793A\u8981\u6C42\u7B80\u6D01\u548C\u6613\u4E8E\u7406\u89E3\u3002\u5728\u8F6F\u4EF6\u5DE5\u7A0B\u9886\u57DF\uFF0C\u8FC4\u4ECA\u4E3A\u6B62\u6CA1\u6709\u7EDF\u4E00\u7684\u9006\u5411\u5DE5\u7A0B\u5B9A\u4E49\u3002\u8F83\u4E3A\u901A\u7528\u7684\u662FEliot Chikafsky\u548CCross\u5728\u6587\u732E\u4E2D\u5B9A\u4E49\u7684\u9006\u5411\u5DE5\u7A0B\u7684\u76F8\u5173\u672F\u8BED\u3002 \u6B63\u5411\u5DE5\u7A0B\uFF1A\u4ECE\u9AD8\u5C42\u62BD\u8C61\u548C\u72EC\u7ACB\u4E8E\u5B9E\u73B0\u7684\u903B\u8F91\u8BBE\u8BA1\u5230\u4E00\u4E2A\u7CFB\u7EDF\u7684\u7269\u7406\u5B9E\u73B0\u7684\u4F20\u7EDF\u5F00\u53D1\u8FC7\u7A0B\u3002 \u9006\u5411\u5DE5\u7A0B\uFF1A\u5206\u6790\u76EE\u6807\u7CFB\u7EDF\uFF0C\u8BA4\u5B9A\u7CFB\u7EDF\u7684\u6784\u4EF6\u53CA\u5176\u4EA4\u4E92\u5173\u7CFB\uFF0C\u5E76\u4E14\u901A\u8FC7\u9AD8\u5C42\u62BD\u8C61\u6216\u5176\u4ED6\u5F62\u5F0F\u6765\u5C55\u73B0\u76EE\u6807\u7CFB\u7EDF\u7684\u8FC7\u7A0B\u3002 \u4E0E\u9006\u5411\u5DE5\u7A0B\u76F8\u5173\u7684\u5176\u4ED6\u672F\u8BED\u5305\u62EC\uFF1A\u518D\u6587\u6863\uFF08Redocumentation\uFF09\uFF1A\u6839\u636E\u6E90\u4EE3\u7801\uFF0C\u5728\u540C\u4E00\u5C42\u6B21\u4E0A\u521B\u5EFA\u6216\u4FEE\u6539\u7CFB\u7EDF\u6587\u6863\u3002 \u8BBE\u8BA1\u6062\u590D\uFF08Design Recovery\uFF09\uFF1A\u7ED3\u5408\u76EE\u6807\u7CFB\u7EDF\u3001\u9886\u57DF\u77E5\u8BC6\u548C\u5916\u90E8\u4FE1\u606F\u8BA4\u5B9A\u66F4\u9AD8\u5C42\u6B21\u7684\u62BD\u8C61\u3002 \u91CD\u6784\uFF08Restructuring\uFF09\uFF1A\u4FDD\u6301\u7CFB\u7EDF\u5916\u90E8\u884C\u4E3A\uFF08\u529F\u80FD\u548C\u8BED\u4E49\uFF09\uFF0C\u5728\u540C\u4E00\u62BD\u8C61\u5C42\u6B21\u4E0A\u6539\u53D8\u8868\u793A\u5F62\u5F0F\u3002 \u518D\u5DE5\u7A0B\uFF08Reengineering\uFF09\uFF1A\u7ED3\u5408\u9006\u5411\u5DE5\u7A0B\u3001\u91CD\u6784\u548C\u6B63\u5411\u5DE5\u7A0B\u5BF9\u73B0\u6709\u7CFB\u7EDF\u8FDB\u884C\u5BA1\u67E5\u548C\u6539\u9020\uFF0C\u5C06\u5176\u91CD\u7EC4\u4E3A\u4E00\u79CD\u65B0\u5F62\u5F0F\u3002 \u4F53\u7CFB\u7ED3\u6784\u518D\u73B0\uFF1A\u7528\u4E8E\u4ECE\u6E90\u7801\u3001\u6027\u80FD\u5206\u6790\u4FE1\u606F\u3001\u8BBE\u8BA1\u6587\u6863\u53CA\u4E13\u5BB6\u77E5\u8BC6\u7B49\u73B0\u6709\u4FE1\u606F\u4E2D\u62BD\u8C61\u51FA\u4E00\u4E2A\u66F4\u9AD8\u5C42\u6B21\u8868\u793A\u7684\u6280\u672F\u548C\u8FC7\u7A0B\u3002 \u5176\u4E2D\uFF0C\u518D\u6587\u6863\u3001\u8BBE\u8BA1\u6062\u590D\u4E0D\u6539\u53D8\u7CFB\u7EDF\u3002\u91CD\u6784\u6539\u53D8\u4E86\u7CFB\u7EDF\uFF0C\u4F46\u4E0D\u6539\u53D8\u5176\u529F\u80FD\u3002\u518D\u5DE5\u7A0B\u901A\u5E38\u6D89\u53CA\u9006\u5411\u5DE5\u7A0B\u4E0E\u6B63\u5411\u5DE5\u7A0B\u7684\u8054\u5408\u4F7F\u7528\uFF0C\u9006\u5411\u5DE5\u7A0B\u89E3\u51B3\u7A0B\u5E8F\u7684\u7406\u89E3\u95EE\u9898\uFF0C\u6B63\u5411\u5DE5\u7A0B\u68C0\u9A8C\u54EA\u4E9B\u529F\u80FD\u9700\u8981\u4FDD\u7559\u3001\u5220\u9664\u6216\u589E\u52A0\u3002\u518D\u5DE5\u7A0B\u6539\u53D8\u4E86\u7CFB\u7EDF\u7684\u529F\u80FD\u548C\u65B9\u5411\uFF0C\u662F\u6700\u6839\u672C\u548C\u6700\u6709\u6DF1\u8FDC\u5F71\u54CD\u7684\u6269\u5C55\u3002\u7531\u6B64\u53EF\u89C1\uFF0C\u91CD\u6784\u662F\u6307\u5728\u540C\u4E00\u62BD\u8C61\u5C42\u6B21\u4E0A\u6539\u53D8\u7CFB\u7EDF\u7684\u8868\u793A\u5F62\u5F0F\uFF0C\u5C06\u67D0\u79CD\u5F62\u5F0F\u8868\u793A\u7684\u8F6F\u4EF6\u8F6C\u6362\u6210\u66F4\u9AD8\u62BD\u8C61\u5F62\u5F0F\u8868\u793A\u7684\u8F6F\u4EF6\u7684\u6D3B\u52A8\u4E0D\u5C5E\u4E8E\u91CD\u6784\uFF0C\u800C\u5C5E\u4E8E\u8F6F\u4EF6\u7684\u9006\u5411\u5DE5\u7A0B\u3002</p>',32),t=[n];function s(o,h){return l(),e("div",null,t)}const c=i(a,[["render",s],["__file","systemanalysis.html.vue"]]);export{c as default};
